import React from 'react';
import { ReactComponent as CommunityIcon } from '../assets/icons/Vector.svg'; // Import SVG as a React component
import avatarImage from '../assets/Mr-Journaler-front-1.png'; // Correct path to your avatar image
import ellipseImage from '../assets/ellipse.png'; // Correct path to your ellipse image
import unionImage from '../assets/union.png'; // Correct path to your union image

const Header = () => (
  <div className="header">
    <div className="avatar-container">
      {/* Ellipse Shape */}
      <img
        src={ellipseImage}
        alt="Ellipse Background"
        className="ellipse"
      />

      {/* Union Shape and Avatar */}
      <div className="union-shape">
        <img
          src={unionImage}
          alt="Union Background"
          className="union-image"
        />
        <img
          src={avatarImage}
          alt="Chatbot Avatar"
          className="avatar-image"
        />
      </div>
    </div>

    {/* Go to Community Button */}
    <div className="community-button-container">
      <div className="community-button">
        {/* Icon inside the button */}
        <CommunityIcon className="community-button-icon" />
        {/* Button Text */}
        <div className="community-button-text">Go to community</div>
      </div>
    </div>
  </div>
);

export default Header;
